import "./App.css";

function App() {
  return (
    <div className="flex container h-screen">
      <SideBar />
      <Welcome />
      <RightBar />

    </div>
  );
}
function SideBar() {
  return (
    <div className="h-full bg-purple-400 px-5">
      <h1>SideBar</h1>
    </div>
  );
}
function Welcome() {
  return (
    <div className="py-5 px-2 bg-pink-400 h-2/6 w-screen">
      <h1>Welcome Yashika!</h1>
    </div>
  );
}
function RightBar() {
  return (
    <div className="bg-yellow-200">
      <div>
        <h1>Calender</h1>
      </div>
      <div>
        <h1>Music</h1>
      </div>
    </div>
  );
}
function Explore() {
  return (
    <div className="flex-row">
      <h1>Explore Today!</h1>
    </div>
  );
}
export default App;
